import './App.css';
import React from "react";
import Login from "./login.js";
import { HashRouter as Router, Route, Switch } from "react-router-dom";
import Menu from './menu';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Menu} />
        <Route path="/about" component={Login} />
      </Switch>
    </Router>
  );
}



